import React from 'react';

import { AiTwotoneHome } from "react-icons/all";

import { Wrapper, Header, Content, Button, Box, Text   } from './styles';

import logo from '../../assets/images/logo.png';

function Main() {
  return (
      <Wrapper>
        <Header>
        <img src={logo}/>
         <h1>Hello, World!</h1>
         <div>asasasas</div>
        </Header>
        <Content>

           <span>asahsaushasuahsuahsaus</span>
            <Box>
                <Text>Entrar</Text>
              
                  <Button>
                        <span>Entrar</span>
                  </Button>

            </Box>
        </Content>
      </Wrapper>  
  )
}

export default Main;
